import "./About.css";
import styled from 'styled-components'
import { SiTypescript, SiJavascript, SiHtml5, SiCss3, SiReact, SiGit, SiStyledcomponents, SiSass, SiPostgresql, SiHeroku } from 'react-icons/si';
import { DiSass } from 'react-icons/di'

const AboutGrid = styled('div')({
    display: 'grid',
    gridTemplateColumns: 'repeat(2, 1fr)',
    gridTemplateRows: 'repeat(1, 1fr)',
});

const DivCol = styled('div')({
    display: 'flex',
    flexDirection: 'column',
    minWidth: '0px',
    width: '100%',
    height: '100%',
  });

function About() {
  return (
    <div className="about">
        <body>
      <h1>About me</h1>
      <p style={{ paddingTop: "55px" }}>
        Full stack developer. From Michigan,
        based in Tennessee.
      </p>
      <AboutGrid>
      <DivCol style={{gridColumn: '1', gridRow: '1'}}>
      <h2 style={{paddingTop: '25px'}}>Experience</h2>
      <p style={{paddingTop: '10px'}}>Joint Special Operations Command</p>
      <p style={{color: 'rgb(81, 193, 241)'}}>current</p>
      </DivCol>
      <DivCol style={{gridColumn: '2', gridRow: '1'}}>
      <h2 style={{paddingTop: '25px'}}>Education</h2>
      <p style={{paddingTop: '10px'}}>Galvanize SDI</p>
      <p style={{paddingTop: '10px'}}>Universty of Penn State 2022-2026</p>
      </DivCol>
      {/* <div className="wrapper">
        <h2 style={{textAlign: 'center'}}>Skills</h2>
      <p class="marquee" >
  <p style={{fontSize: '50px'}}><SiJavascript s /><SiHeroku  /><SiStyledcomponents style={{marginRight:'10%'}}/><i class="fab fa-golang"/><SiTypescript style={{marginRight:'10%'}}/><SiHtml5 style={{marginRight:'10%'}}/><SiCss3 style={{marginRight:'10%'}}/><DiSass style={{marginRight:'10%'}}/><SiReact style={{marginRight:'10%'}}/><SiGit style={{marginRight:'10%'}}/>&nbsp;</p>;
</p>

</div> */}
</AboutGrid>
<div class="wrapper">
  <div class="marquee">
    <p>
    <SiJavascript/><SiHeroku/><SiStyledcomponents/><i class="fab fa-golang"/><SiTypescript/><SiHtml5 /><SiCss3 /><DiSass s /><SiReact /><SiGit />&nbsp;
    </p>
    <p>
    <SiJavascript/><SiHeroku/><SiStyledcomponents/><i class="fab fa-golang"/><SiTypescript /><SiHtml5 /><SiCss3/><DiSass/><SiReact/><SiGit/>&nbsp;
    </p>
  </div>
</div>

      </body>
    </div>
  );
}

export default About;
